import React from 'react';

function Footer() {
    return(
        <div>
            <div>
                <center>
                    <p className="text-muted credit">
                        All Finn laws can be found from <a href="https://www.finlex.fi/fi/">Finlex</a> and are in public domain.
                    </p>
                </center>
            </div>
        </div>
    );
};

export default Footer;
